import React from "react";
import { Button, Card, CardBody, CardTitle, Col } from "mdbreact";

export default class Device extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    render() {
        const { attributes, deleteDevice } = this.props;
        let attributesHtml = attributes.map((att, idx) => {
            return <li key={idx}>{att.name}</li>;
        });
        let devices = this.props.devices.map((device, idx) => {
            return (
                <Col key={idx}>
                    <Card style={{ width: "22rem" }}>
                        <CardBody>
                            <CardTitle>{device.identifier}</CardTitle>
                            <div>
                                <b>Indentifier</b>
                                <br />
                                {device.identifier}
                            </div>
                            <div>
                                <b>Owner</b>
                                <br />
                                {device.owner}
                            </div>
                            <div>
                                <b>Last Activity</b>
                                <br />
                                {device.activity}
                            </div>
                            <div>
                                <b>Self Registered</b>
                                <br />
                                {device.registered}
                            </div>
                            <div>
                                <b>Attributes</b>
                                <br />
                                <ul>{attributesHtml}:</ul>
                            </div>
                            <Button color="green">Edit Attributes</Button>
                            <Button
                                color="red"
                                onClick={() => {
                                    deleteDevice(device.id);
                                }}
                            >
                                Delete Device
                            </Button>
                        </CardBody>
                    </Card>
                </Col>
            );
        });

        return <div className="devices-container">{devices}</div>;
    }
}
